// 图像处理总流程函数
function recongnize(image) {
    // 定义标准数据
    const STANDARD_WORDS_COUNT = 4; // 标准字数
    const STANDARD_WORD_WIDTH = 8; // 标准字宽度
    const STANDARD_WORD_HEIGHT = 10; // 标准字高度
    // 创建canvas，绘制图片
    const canvas = document.createElement('canvas');
    const width = canvas.width = image.width;
    const height = canvas.height = image.height;
    const ctx = canvas.getContext('2d');
    ctx.drawImage(image, 0, 0, image.width, image.height, 0, 0, image.width, image.height);

    // 二值化
    const imageData = toHex(image, ctx);

    // 腐蚀、膨胀
    corrode(imageData);
    expand(imageData);

    // 切割
    let words = split(imageData, ctx, STANDARD_WORDS_COUNT);

    // 如果切割失败就返回false; 由调用者处理（比如更换验证码再来一次）
    if (words.length !== STANDARD_WORDS_COUNT) {
        return false;
    }

    // 缩放
    for (let i = 0; i < words.length; i++) {
        words[i] = zoomToFit(words[i], STANDARD_WORD_WIDTH, STANDARD_WORD_HEIGHT);
    }

    return words;
}

function toHex(image, ctx) {
    const imageData = [];
    let average,
    plus = 0;

    // 首先获取图片灰度信息储存到array，同时计算平均灰度值
    // 格式：二维数组，前两维度是坐标，最后一维是(R+G+B)*A/255
    let line = [];
    for (let x = 0; x < image.width; x++) {
        line = [];
        for (let y = 0; y < image.height; y++) {
            const pixel = ctx.getImageData(x, y, 1, 1).data;
            line[y] = (pixel[0] + pixel[1] + pixel[2]) / 3 * (pixel[3] / 255);
            plus += line[y];
        }
        imageData[x] = line;
    }
    average = plus / (image.width * image.height);

    // 二值化
    for (let x = 0; x < image.width; x++) {
        for (let y = 0; y < image.height; y++) {
            if (imageData[x][y] < average) {
                imageData[x][y] = 0;
            } else {
                imageData[x][y] = 1;
            }
        }
    }

    return imageData;
}

// 腐蚀：去除背景噪点
function corrode(imageData) {
    for (let x = 0; x < imageData.length; x++) {
        for (let y = 0; y < imageData[x].length; y++) {
            const isNoise = (imageData[x][y] === 1 && (x === 0 || imageData[x - 1][y] === 0) && (y === 0 || imageData[x][y - 1] === 0) && (x === imageData.length - 1 || imageData[x + 1][y] === 0) && (y === imageData[x].length - 1 || imageData[x][y + 1] === 0))
            if (isNoise) {
                imageData[x][y] = 0;
            }
        }
    }
}

// 膨胀：去除字中噪点
function expand(imageData) {
    for (let x = 0; x < imageData.length; x++) {
        for (let y = 0; y < imageData[x].length; y++) {
            const isNoise = (imageData[x][y] === 0 && (x === 0 || imageData[x - 1][y] === 1) && (y === 0 || imageData[x][y - 1] === 1) && (x === imageData.length - 1 || imageData[x + 1][y] === 1) && (y === imageData[x].length - 1 || imageData[x][y + 1] === 1))
            if (isNoise) {
                imageData[x][y] = 1;
            }
        }
    }
}

// 切割：去除空行空列，获取单字
// 参数num：应该识别出来的正确字数
// 返回数据：三维数组，第一维引用每个字，后两维度储存字
function split(imageData, ctx, num) {
    // 先横切，去除上下空行（注意横切要用的是y不是x）
    let count = 0;
    for (let y = 0; y < imageData[0].length; y++) {
        count = 0;
        for (let x = 0; x < imageData.length; x++) {
            count += imageData[x][y];
        }
        if (count === 0) {
            for (let x = 0; x < imageData.length; x++) {
                imageData[x].splice(y, 1);
            }
            y--;
        }
    }

    // 纵切，获取单字
    let inWord,
    words,
    word,
    accuracy;
    let wrongAccuracy = [];
    accuracy = 1; // 容许的误差有几格
    while (true) {
        inWord = false;
        words = [];
        word = [];
        for (let x = 0; x < imageData.length; x++) {
            count = 0;
            for (let y = 0; y < imageData[x].length; y++) {
                count += imageData[x][y];
            }
            if (count <= accuracy) {
                //imageData.splice(x, 1);
                //x--;
                if (inWord) {
                    words.push(word);
                    inWord = false;
                    word = [];
                }
            } else {
                inWord = true;
                word.push(imageData[x]);
            }
        }
        if (words.length > num) {
            // 分割过度，减少容许的误差再试一次
            wrongAccuracy.push(accuracy);
            accuracy--;
            // 如果减少也不行的话就直接返回吧
            if (wrongAccuracy.indexOf(accuracy) !== -1) {
                break;
            }
        } else if (words.length < num) {
            // 分割不足，增加容许的误差再试一次
            wrongAccuracy.push(accuracy);
            accuracy++;
            // 如果增加也不行的话就直接返回吧
            if (wrongAccuracy.indexOf(accuracy) !== -1) {
                break;
            }
        } else {
            // 分割正确，跳出循环，返回结果
            break;
        }
    }

    return words;
}

// 缩放
function zoomToFit(word, width, height) {
    // 创建两个canvas用于缩放、处理数据
    const canvas1 = document.createElement('canvas');
    const ctx1 = canvas1.getContext('2d');
    canvas1.width = word.length;
    canvas1.height = word[0].length;
    const canvas2 = document.createElement('canvas');
    const ctx2 = canvas2.getContext('2d');
    canvas2.width = width;
    canvas2.height = height;
    // 先原比例画到canvas1上
    display(word, ctx1);
    const wordData = ctx1.getImageData(0, 0, word.length, word[0].length);
    // 再按照给定的比例画到canvas2上
    ctx2.drawImage(canvas1, 0, 0, width, height);
    // 获取并将canvas2的imageData转化为数组存储
    let imageData = [],
    line = [];
    for (let x = 0; x < width; x++) {
        line = [];
        for (let y = 0; y < height; y++) {
            const color = ctx2.getImageData(x, y, 1, 1).data[0];
            line[y] = (color === 0 ? 0 : 1);
        }
        imageData[x] = line;
    }
    return imageData;
}

// 把数组数据画到canvas上
function display(imageData, ctx) {
    ctx.canvas.width = imageData.length;
    ctx.canvas.height = imageData[0].length;
    for (let x = 0; x < imageData.length; x++) {
        for (let y = 0; y < imageData[x].length; y++) {
            const pixel = ctx.getImageData(x, y, 1, 1);
            const pixelData = pixel.data;
            pixelData[0] = pixelData[1] = pixelData[2] = (imageData[x][y] === 0 ? 0 : 255);
            pixelData[3] = 255;
            ctx.putImageData(pixel, x, y);
        }
    }
}
// =======================图像处理部分结束=======================

// =======================数据匹配部分开始=======================
// 根据数据库识别验证码
function rec_image(image) {
    const words = recongnize(image);
    // 图像处理成功，识别并返回；图像处理失败，返回false
    if (words) {
        return rec_code(words);
    } else {
        return false;
    }
}

// 根据数据库识别验证码数组
function rec_code(words) {
    let code = '';
    for (let i = 0; i < words.length; i++) {
        code += rec_word(words[i]);
    }
    return code;
}

// 根据数据库识别验证码单字
function rec_word(word) {
    const chars = '0123456789abcdefghijklmnopqrstuvwxyz'.split('');

    // 逐一比对
    let max = {
        same: 0,
        char: ''
    }
    let same = 0;
    for (let i = 0; i < chars.length; i++) {
        for (let j = 0; j < database[chars[i]].length; j++) {
            same = compare(word, database[chars[i]][j]);
            max = (same > max.same ? {
                same: same,
                char: chars[i]
            }: max);
        }
    }

    return max.char;
}

// 比对两个word，获取相关度
function compare(word1, word2) {
    let same = 0;
    for (let x = 0; x < word1.length; x++) {
        for (let y = 0; y < word1[x].length; y++) {
            same += (word1[x][y] === word2[x][y] ? 1 : 0);
        }
    }
    return same;
}